import {
  Login,
} from "../Pages";
import Dashboard from "../components/Dashboard/Dashboard";

export const routerList = [
  {
    path: "/login",
    element: Login,
    private: 0,
  },
  {
    path: "/dashboard",
    element: Dashboard,
    private: 1,
  },
];

export { ProtectRoutes } from "./ProtectRoutes";
export { PublicRoute } from "./PublicRoute";
